                      <span class="d-flex align-items-center text-plain-title-l">1</span>
                      <div class="vr"></div>
                      <div>{{ __('messages.dp_step1') }}</div>
                    </li>
                    <li class="d-flex gap-3 py-3">
                      <span class="d-flex align-items-center text-plain-title-l">2</span>
                      <div class="vr"></div>
                      <div>{{ __('messages.dp_step2') }}</div>
                    </li>
                    <li class="d-flex gap-3 py-3">
                      <span class="d-flex align-items-center text-plain-title-l">3</span>
                      <div class="vr"></div>
                      <div id="dps-step3">
                        <span>{{ __('messages.dp_step3') }}</span>
                        <div class="d-flex gap-3 align-items-center mt-2">
                          <section class="flex-grow-1">
                            <div class="input-group">
                              <div class="d-flex align-items-center gap-2 w-100 pe-2">
                                <input autocomplete="off" class="form-control e2e-text-input text-center" id="dps-otp"
                                  name="otp" type="tel" maxlength="6" placeholder=""
                                  aria-label="{{ __('messages.dp_otp_label') }}">
                              </div>
                            </div>
                          </section>
                          <button name="submit" type="submit" class="btn btn-prominent" disabled
                            id="dps-submit-btn">{{ __('messages.dp_connect') }}</button>
